import React from "react";
import {Link} from "react-router-dom";

function Navbar(){
    return (<nav style={{display:'flex'}}>
        <h4><Link to='/'>HOME</Link></h4>
        <h4><Link to='/notes'>Notes</Link></h4>
        <h4><Link to='/create'>Create Notes</Link></h4>

    </nav>

    )}

export default Navbar;
